import { StatusBar } from 'expo-status-bar';
import { useEffect, useState } from 'react';
import { StyleSheet, Text, View, ActivityIndicator, Button, TextInput } from 'react-native';
import styles from '../styles'

function Cadastro(){

    const [ nome, setNome] = useState('');
    const [ email, setEmail] =  useState('');
    const [ senha, setSenha] = useState('');
    const [ telefone, setTelefone] = useState('');
    const [ datanasc, setDatanasc] = useState('');
    const [ sexo, setSexo] = useState('');
    const [ profissao, setProfissao] = useState('');
    const [ cidade, setCidade] = useState('');
    const [ uf, setUf] = useState('');
    const [ cpf, setCpf] = useState('');
    const [ fotoperfil, setFotoperfil] = useState('');
    const [ isvoluntario, setIsvoluntario] = useState('');


    function cadastrar(){
        fetch('http://localhost:3001/posts', {
            method: 'POST',
            headers:{
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                nome : nome,
                e_mail : email,
                senha : senha,
                telefone : telefone,
                data_nasc : datanasc,
                sexo : sexo,
                profissao : profissao,
                cidade : cidade,
                uf : uf,
                cpf : cpf,
                foto_perfil : fotoperfil,
                is_voluntario : isvoluntario,
            })
        }).then(res => res.json())
        .then(res=>console.log(res))
        .catch(err => console.log(err))
        ;
    }    

    return (
        <>
        <View>
            <Text>nome</Text>
            <TextInput onChangeText={(nome)=>setNome(titulo)} />
        </View>
        <View>
            <Text>e-mail</Text>
            <TextInput onChangeText={(conteudo)=>setConteudo(conteudo)} />
        </View>
        <View>
            <Button onPress={()=>cadastrar()} title='Cadastrar'/>
        </View>
        </>
    );
}

export default Cadastro;
